(2401, '7E1244A6-3ABA-4F73-A9BA-7E3F33004B6B', 'Laboratory: Professor Lisa Pruitt Graduate Student Mentor: Noah Bonnheim Mentor’s Email: noah.bonnheim@berkeley.edu Mentor’s Bio: I am a 3rd year student in the Department of Mechanical Engineering, working specifically in the Orthopedic Biomechanics Group. My research focuses on orthopedic implant design, failure analysis, and material characterization. My current projects include a computational study on the mechanics of total disc replacement implants in the spine, analysis of failed components following total knee replacement surgery, and the fatigue fracture behavior of PEEK, a polymer used extensively in orthopedics. I graduated from Dartmouth with a bachelor of engineering.', 'David', 'Nitzan', '2017-09-26T15:48:13'),
